import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
var app = (
    <div>
    <section className="table">
    <App name = "left_title" id="home" path = "#Home" content = "Home"/>
    <App name = "left_title" id="aboutme" path = "#About Me"content = "About Me"/>
    <App name = "left_title" id="nan" path = "#Contact Me" content = "Contact Me"/>
    <App name = "right_title" id="login" path = "#Login" content = "Login"/>
    </section>
    </div>
);
ReactDOM.render(
    app,
  document.getElementById('#root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
